import './style.css';

import LoginForm from '../../components/Forms/LoginForm';

function Login() {
  return (
    <article className="Login">
      <aside>
        <h1 className='TitleLogin'>
          Gerencie todos os pagamentos da sua empresa em um só lugar.
        </h1>
      </aside>
      <main>
        <LoginForm />
      </main>
    </article>
  );
}

export default Login;
